export default class UserModel{

    private uid:number;
    private username:string;
    private email:string;
    private avtImgUrl :string;

    constructor(uid:number,username:string,email:string,avtImgUrl:string){
        this.uid = uid,
        this.username = username;
        this.email = email;
        this.avtImgUrl= avtImgUrl;
    }
}
